const canvas = document.getElementById('scratchCanvas');
const ctx = canvas.getContext('2d');
const container = document.querySelector('.scratch-container');
const invitation = document.getElementById('invitation');

// Adjust canvas size to match the container
canvas.width = container.offsetWidth;
canvas.height = container.offsetHeight;

// Create an image object
const image = new Image();
image.src = 'data:image/jpeg;base64,';
 // Replace with your local image path

// Draw the image on the canvas once it's loaded
image.onload = () => {
  // Calculate scaling to cover the canvas
  const imgRatio = image.width / image.height;
  const canvasRatio = canvas.width / canvas.height;

  let drawWidth, drawHeight, offsetX, offsetY;

  if (canvasRatio > imgRatio) {
    drawWidth = canvas.width;
    drawHeight = canvas.width / imgRatio;
    offsetX = 0;
    offsetY = (canvas.height - drawHeight) / 2;
  } else {
    drawWidth = canvas.height * imgRatio;
    drawHeight = canvas.height;
    offsetX = (canvas.width - drawWidth) / 2;
    offsetY = 0;
  }

  // Create rounded corners
  const radius = 20; // Adjust for rounded corners
  ctx.beginPath();
  ctx.moveTo(radius, 0);
  ctx.lineTo(canvas.width - radius, 0);
  ctx.quadraticCurveTo(canvas.width, 0, canvas.width, radius);
  ctx.lineTo(canvas.width, canvas.height - radius);
  ctx.quadraticCurveTo(canvas.width, canvas.height, canvas.width - radius, canvas.height);
  ctx.lineTo(radius, canvas.height);
  ctx.quadraticCurveTo(0, canvas.height, 0, canvas.height - radius);
  ctx.lineTo(0, radius);
  ctx.quadraticCurveTo(0, 0, radius, 0);
  ctx.closePath();

  // Clip to rounded corners
  ctx.clip();

  // Draw the image to cover the canvas
  ctx.drawImage(image, offsetX, offsetY, drawWidth, drawHeight);
};

// Scratch settings
let isScratching = false;

// Helper function to get touch/mouse position
function getPosition(event) {
  const rect = canvas.getBoundingClientRect();
  if (event.touches) {
    return {
      x: event.touches[0].clientX - rect.left,
      y: event.touches[0].clientY - rect.top
    };
  } else {
    return {
      x: event.clientX - rect.left,
      y: event.clientY - rect.top
    };
  }
}

// Start scratching
function startScratch(event) {
  isScratching = true;
  scratch(event);
}

// Stop scratching
function stopScratch() {
  isScratching = false;
  ctx.beginPath();

  // Check if enough of the canvas is scratched
  if (isRevealed()) {
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    // Optionally, you can fill the canvas with a solid background color if needed:
    ctx.fillStyle = "#ffffff"; // Choose a background color (white here)
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    // Show the invitation once revealed
    invitation.classList.remove('hidden');
   // Reveal invitation when 75% is scratched
    
  }
}

// Scratch on canvas
function scratch(event) {
  if (!isScratching) return;

  const { x, y } = getPosition(event);

  ctx.globalCompositeOperation = 'destination-out';
  ctx.beginPath();
  ctx.arc(x, y, 20, 0, Math.PI * 2, false);
  ctx.fill();
}

// Check if canvas is sufficiently scratched (75%)
function isRevealed() {
  const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
  const pixels = imageData.data;
  let transparentPixels = 0;

  // Loop through every pixel and count transparent ones
  for (let i = 3; i < pixels.length; i += 4) {
    if (pixels[i] === 0) transparentPixels++; // Check alpha channel for transparency
  }

  const transparencyPercentage = (transparentPixels / (pixels.length / 4)) * 100;
  console.log(transparencyPercentage); // Debugging to see the percentage of transparency

  // Return true if more than 75% of the canvas is scratched
  return transparencyPercentage > 75;
}

// Event listeners for mouse and touch
canvas.addEventListener('mousedown', startScratch);
canvas.addEventListener('mousemove', scratch);
canvas.addEventListener('mouseup', stopScratch);

canvas.addEventListener('touchstart', (event) => {
  event.preventDefault(); // Prevent scrolling
  startScratch(event);
});

canvas.addEventListener('touchmove', (event) => {
  event.preventDefault(); // Prevent scrolling
  scratch(event);
});

canvas.addEventListener('touchend', (event) => {
  event.preventDefault(); // Prevent scrolling
  stopScratch();
});
